import React from 'react';
import Todo from './Todo';

const TodoList = ({ todos, handleTodoToggle }) => {
  return (
    <div className="todo-list" style={{alignSelf: 'start'}}>
      {todos.map(todo => (
        <Todo key={todo.id} todo={todo} handleTodoToggle={handleTodoToggle} />
      ))}
    </div>
  );
};

export default TodoList;
